import React, { Component } from 'react'
import axios from "axios";

export default class Hospital_Details extends Component {
    constructor(props) {
        super(props);
        this.state = {
          res: {
            hospital_data:"",
          },
        };
      }

      componentDidMount() {
        axios
          .get("https://www.hpb.health.gov.lk/api/get-current-statistical")
          .then((response) => {
            console.log(response.data.data);
            this.setState({ res: response.data.data });
          })
          .catch(function (err) {
            console.log(err);
          });
      }

    render() {
        return (
            <div>
                <h1>{this.state.res.hospital_data.hospital.name_si}</h1>
            </div>
        )
    }
}
